import React from 'react';
import {DragDropContext, Droppable, Draggable} from "react-beautiful-dnd";
import './DraggableList.css';

const DraggableList = (props) => {

let array = [
    {
        id: 'list-1',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-2',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-3',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-4',
        title: 'Automatic',
        thumb: '/path/to/icon'
    }
]


  return (

    <DragDropContext>
        <Droppable droppableId="list">

            <ul className="myList" >
                {array.map(({id, title, thumb}, index) => {
                    return (

                                <li >
                                     <div>   {index+1 +". "}
                                    { title }
                                    </div>
                                </li>

                    );
                })}
            </ul>
        </Droppable>
    </DragDropContext>
  )
}

export default DraggableList;
